import React from 'react';
import { Header } from 'components';
import { Board } from './';

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            boardList : []
        };
    }
    render(){
        let re = /(login|detail)/;
        let isAuth = re.test(this.props.location.pathname);

        return (
            <div>
               {isAuth ? undefined : <Header />}
               <Board />
            </div>
        );
    }
}


export default Home;
